import React , {Component} from 'react'

onSubmit = (e) => {
  e.preventDefault();
  this.props.predict();
};

export class Form extends Component{
  reder () {
      return (
        <div>
            <h2 className='title'>
              {this.props.title}
            </h2>
            <form className='form' >
                <label for='Transaction Date'>Transaction Date: </label>
                <input type='date' id='Transaction Date'/>
    
                <label for='House age'>House age: </label>
                <input type='number' id='House age' step='.01' placeholder='0' />
    
                <label for='MRT'>Distance to the nearest Metro Station(Metres): </label>
                <input type='number' id='MRT' step='0.00001' placeholder='0'/>
    
                <label for='Convinience Store'>Convinience Store: </label>
                <input type='number' id='Convinience Store' placeholder='0'/>
    
                <label for='Latitude'>Latitude: </label>
                <input type='number' id='Latitude' step='0.00001' placeholder='0'/>
    
                <label for='Longitude'>Longitude: </label>
                <input type='number' id='Longitude' step='0.00001' placeholder='0'/>
    
                <input type='submit'  value='Predict' className='submit' />
            </form>
            <form className='answer'>
              <label for='Prediction'>Predicted Price: </label>
              <input type='text' id='Prediction' value='' placeholder='Predicted Price will appear here'/>
            </form>
        </div>
      )
  }
}




export default Form;
